{"title":"Topology","type":"vega","params":{"spec":"{
  $schema: https://vega.github.io/schema/vega/v4.json
  data: [
    {
      name: masters
      url: {
        %context%: true
        %timefield%: @timestamp
        index: master-connections-*
        body: {
          size: 0
          aggs: {
            nodes: {
              terms: {
                field: "parsed.src.keyword",
                size: 100
              }
            }
          }
        }
      }
      format: {property: "aggregations.nodes.buckets"}
      transform: [
        {
          type: formula
          as: "group"
          expr: "'master'"
        }
      ]
    }
    {
      name: relays
      url: {
        %context%: true
        %timefield%: @timestamp
        index: relay-connections-*
        body: {
          size: 0
          aggs: {
            nodes: {
              terms: {
                field: "parsed.src.keyword",
                size: 100
              }
            }
          }
        }
      }
      format: {property: "aggregations.nodes.buckets"}
      transform: [
        {
          type: formula
          as: "group"
          expr: "'relay'"
        }
      ]
    }
    {
      name: msggens
      url: {
        %context%: true
        %timefield%: @timestamp
        index: msggen-connections-*
        body: {
          size: 0
          aggs: {
            nodes: {
              terms: {
                field: "parsed.src.keyword",
                size: 100
              }
            }
          }
        }
      }
      format: {property: "aggregations.nodes.buckets"}
      transform: [
        {
          type: formula
          as: "group"
          expr: "'msggen'"
        }
      ]
    }
    {
      name: nodes
      source: ["masters", "relays"]
    }
    {
      name: masterlinks
      url: {
        %context%: true
        %timefield%: @timestamp
        index: master-connections-*
        body: {
          size: 0
          aggs: {
            sol: {
              filter: {term: {parsed.type: "sol"}}
              aggs: {
                nodes: {
                  terms: {
                    script: {
                      source: doc['parsed.src.keyword'].value + '|' + doc['parsed.dst.keyword'].value
                      lang: painless
                    }
                    size: 200
                  }
                  aggs: {
                    link: {
                      top_hits: {
                        size: 1
                        _source: {
                          includes: ["parsed.src", "parsed.dst"]
                        }
                      }
                    }
                  }
                }
              }
            }
          }
        }
      }
      format: {property: "aggregations.sol.nodes.buckets"}
      transform: [
        {
          type: project
          as: ["source", "target"]
          fields: ["link.hits.hits[0]._source.parsed.src", "link.hits.hits[0]._source.parsed.dst"]
        }
      ]
    }
    {
      name: relaylinks
      url: {
        %context%: true
        %timefield%: @timestamp
        index: relay-connections-*
        body: {
          size: 0
          aggs: {
            sol: {
              filter: {terms: {parsed.type: ["sol", "standby"]}}
              aggs: {
                nodes: {
                  terms: {
                    script: {
                      source: doc['parsed.src.keyword'].value + '|' + doc['parsed.dst.keyword'].value
                      lang: painless
                    }
                    size: 200
                  }
                  aggs: {
                    link: {
                      top_hits: {
                        size: 1
                        _source: {
                          includes: ["parsed.src", "parsed.dst"]
                        }
                      }
                    }
                  }
                }
              }
            }
          }
        }
      }
      format: {property: "aggregations.sol.nodes.buckets"}
      transform: [
        {
          type: project
          as: ["source", "target"]
          fields: ["link.hits.hits[0]._source.parsed.src", "link.hits.hits[0]._source.parsed.dst"]
        }
      ]
    }
    {
      name: msggenlinks
      url: {
        %context%: true
        %timefield%: @timestamp
        index: msggen-connections-*
        body: {
          size: 0
          aggs: {
            sol: {
              filter: {terms: {parsed.type: ["sol", "standby"]}}
              aggs: {
                nodes: {
                  terms: {
                    script: {
                      source: doc['parsed.src.keyword'].value + '|' + doc['parsed.dst.keyword'].value
                      lang: painless
                    }
                    size: 300
                  }
                  aggs: {
                    link: {
                      top_hits: {
                        size: 1
                        _source: {
                          includes: ["parsed.src", "parsed.dst"]
                        }
                      }
                    }
                  }
                }
              }
            }
          }
        }
      }
      format: {property: "aggregations.sol.nodes.buckets"}
      transform: [
        {
          type: project
          as: ["source", "target"]
          fields: ["link.hits.hits[0]._source.parsed.src", "link.hits.hits[0]._source.parsed.dst"]
        }
      ]
    }
    {
      name: nodelinks
      source: ["masterlinks", "relaylinks"]
    }
  ]
  signals: [
    {name: "cx", update: "width / 2"}
    {name: "cy", update: "height / 2"}
    {
      name: nodeRadius
      value: 16
      bind: {input: "range", min: 1, max: 50, step: 1}
    }
    {
      name: nodeCharge
      value: 0
      bind: {input: "range", min: -100, max: 10, step: 1}
    }
    {
      name: linkDistance
      value: 100
      bind: {input: "range", min: 5, max: 100, step: 1}
    }
    {
      name: static
      value: true
      bind: {input: "checkbox"}
    }
    {
      description: State variable for active node fix status.
      name: fix
      value: false
      on: [
        {events: "symbol:mouseout[!event.buttons], window:mouseup", update: "false"}
        {events: "symbol:mouseover", update: "fix || true"}
        {events: "[symbol:mousedown, window:mouseup] > window:mousemove!", update: "xy()", force: true}
      ]
    }
    {
      description: Graph node most recently interacted with.
      name: node
      value: null
      on: [
        {events: "symbol:mouseover", update: "fix === true ? item() : node"}
      ]
    }
    {
      description: Flag to restart Force simulation upon data changes.
      name: restart
      value: false
      on: [
        {
          events: {signal: "fix"}
          update: fix && fix.length
        }
      ]
    }
  ]
  marks: [
    {
      name: nodemarks
      type: symbol
      zindex: 1
      from: {data: "nodes"}
      on: [
        {
          trigger: fix
          modify: node
          values: fix === true ? {fx: node.x, fy: node.y} : {fx: fix[0], fy: fix[1]}
        }
        {trigger: "!fix", modify: "node", values: "{fx: null, fy: null}"}
      ]
      encode: {
        enter: {
          fill: {"signal": "datum.group == 'red' ? 'red' : 'blue'"}
          stroke: {value: "white"}
        }
        update: {
          size: {signal: "2 * nodeRadius * nodeRadius"}
          cursor: {value: "pointer"}
        }
      }
      transform: [
        {
          type: force
          iterations: 300
          restart: {signal: "restart"}
          static: {signal: "static"}
          signal: force
          forces: [
            {
              force: center
              x: {signal: "cx"}
              y: {signal: "cy"}
            }
            {
              force: collide
              radius: {signal: "nodeRadius"}
            }
            {
              force: nbody
              strength: {signal: "nodeCharge"}
            }
            {
              force: link
              links: nodelinks
              distance: {signal: "linkDistance"}
              id: datum.key
            }
          ]
        }
      ]
    }
    {
      type: path
      from: {data: "nodelinks"}
      interactive: false
      encode: {
        update: {
          stroke: {value: "black"}
          strokeWidth: {value: 1}
        }
      }
      transform: [
        {
          type: linkpath
          require: {signal: "force"}
          shape: line
          sourceX: datum.source.x
          sourceY: datum.source.y
          targetX: datum.target.x
          targetY: datum.target.y
        }
      ]
    }
  ]
}"},"aggs":[]}

{"title":"Latency Histogram","type":"vega","params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v4.json",
  "padding": 50,

  "signals": [
    { "name": "binOffset", "value": 0,
      "bind": {"input": "range", "min": 0, "max": 1000} },
    { "name": "binStep", "value": 10,
      "bind": {"input": "range", "min": 5, "max": 100, "step": 5} }
  ],

  "data": [
    {
      name: msggen
      url: {
        %context%: true
        %timefield%: @timestamp
        index: master-msgs-*
        body: {
          size: 0
          aggs: {
            "diff": {
              "terms": {
                "field": "parsed.msgid.keyword",
                "size": 100
              },
              "aggs": {
                "diff": {
                  "scripted_metric": {
                    "init_script": "state.timings = []",
                    "map_script" : "state.timings.add(doc['@timestamp'].getValue().toInstant().toEpochMilli())",
                    "combine_script" : "long max = 0; long min = 200000000000000L; for (t in state.timings) { max = max < t ? t : max; min = min > t ? t : min; } return (max - min);",
                    "reduce_script" : "long max = 0; for (a in states) { max = max < a ? a : max } return max;"
                  }
                }
              }
            }
          }
        }
      }
      format: {property: "aggregations.diff.buckets"}
    }
    {
      "name": "binned",
      "source": "msggen",
      "transform": [
        {
          "type": "bin", "field": "diff.value",
          "extent": [0, 1000],
          "anchor": {"signal": "binOffset"},
          "step": {"signal": "binStep"},
          "nice": false
        },
        {
          "type": "aggregate",
          "key": "bin0", "groupby": ["bin0", "bin1"],
          "fields": ["bin0"], "ops": ["count"], "as": ["count"]
        }
      ]
    }
  ],

  "scales": [
    {
      "name": "xscale",
      "type": "linear",
      "range": "width",
      "domain": [0, 400]
    },
    {
      "name": "yscale",
      "type": "linear",
      "range": "height", "round": true,
      "domain": {"data": "binned", "field": "count"},
      "zero": true, "nice": true
    }
  ],

  "axes": [
    {"orient": "bottom", "scale": "xscale", "zindex": 1},
    {"orient": "left", "scale": "yscale", "tickCount": 5, "zindex": 1}
  ],

  "marks": [
    {
      "type": "rect",
      "from": {"data": "binned"},
      "encode": {
        "update": {
          "x": {"scale": "xscale", "field": "bin0"},
          "x2": {"scale": "xscale", "field": "bin1",
                 "offset": {"signal": "binStep > 0.02 ? -0.5 : 0"}},
          "y": {"scale": "yscale", "field": "count"},
          "y2": {"scale": "yscale", "value": 0},
          "fill": {"value": "steelblue"}
        },
        "hover": { "fill": {"value": "firebrick"} }
      }
    },
    {
      "type": "rect",
      "from": {"data": "msggen"},
      "encode": {
        "enter": {
          "x": {"scale": "xscale", "field": "diff.value"},
          "width": {"value": 1},
          "y": {"value": 25, "offset": {"signal": "height"}},
          "height": {"value": 5},
          "fill": {"value": "steelblue"},
          "fillOpacity": {"value": 0.4}
        }
      }
    }
  ]
}"},"aggs":[]}

{"title":"Latency CDF","type":"vega","params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v4.json",
  "padding": 50,

  "signals": [
    { "name": "binOffset", "value": 0,
      "bind": {"input": "range", "min": 0, "max": 1000} },
    { "name": "binStep", "value": 10,
      "bind": {"input": "range", "min": 5, "max": 100, "step": 5} }
  ],

  "data": [
    {
      name: msggen
      url: {
        %context%: true
        %timefield%: @timestamp
        index: master-msgs-*
        body: {
          size: 0
          aggs: {
            "diff": {
              "terms": {
                "field": "parsed.msgid.keyword",
                "size": 100
              },
              "aggs": {
                "diff": {
                  "scripted_metric": {
                    "init_script": "state.timings = []",
                    "map_script" : "state.timings.add(doc['@timestamp'].getValue().toInstant().toEpochMilli())",
                    "combine_script" : "long max = 0; long min = 200000000000000L; for (t in state.timings) { max = max < t ? t : max; min = min > t ? t : min; } return (max - min);",
                    "reduce_script" : "long max = 0; for (a in states) { max = max < a ? a : max } return max;"
                  }
                }
              }
            }
          }
        }
      }
      format: {property: "aggregations.diff.buckets"}
    }
    {
      "name": "density",
      "source": "msggen",
      "transform": [
        {
          "type": "density",
          "extent": {"signal": "domain('xscale')"},
          "method": "cdf",
          "distribution": {
            "function": "kde",
            "field": "diff.value",
            "bandwidth": 0
          }
        }
      ]
    },
  ],

"scales": [
    {
      "name": "xscale",
      "type": "linear",
      "range": "width",
      "domain": [0, 400],
      "nice": true
    },
    {
      "name": "yscale",
      "type": "linear",
      "range": "height", "round": true,
      "domain": [0, 1],
      "zero": true,
      "nice": true
    },
    {
      "name": "color",
      "type": "ordinal",
      "domain": ["Normal Estimate", "Kernel Density Estimate"],
      "range": ["#444", "steelblue"]
    }
  ],

  "axes": [
    {"orient": "bottom", "scale": "xscale", "zindex": 1},
    {"orient": "left", "scale": "yscale", "zindex": 1}
  ],

  "marks": [
    {
      "type": "area",
      "from": {"data": "density"},
      "encode": {
        "update": {
          "x": {"scale": "xscale", "field": "value"},
          "y": {"scale": "yscale", "field": "density"},
          "y2": {"scale": "yscale", "value": 0},
          "fill": {"signal": "scale('color', 'Kernel Density Estimate')"}
        }
      }
    },
    {
      "type": "rect",
      "from": {"data": "msggen"},
      "encode": {
        "enter": {
          "x": {"scale": "xscale", "field": "diff.value"},
          "width": {"value": 1},
          "y": {"value": 25, "offset": {"signal": "height"}},
          "height": {"value": 5},
          "fill": {"value": "steelblue"},
          "fillOpacity": {"value": 0.4}
        }
      }
    }
  ]
}"},"aggs":[]}
